import { Component, OnInit } from '@angular/core';
import { ApiService } from '../api.service';
import { HttpHeaders } from '@angular/common/http';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css'],
})
export class SignupComponent implements OnInit {
  signupData = {
    username: '',
    password: '',
    verifyPassword: '',
  };

  constructor(private apiService: ApiService) { }

  ngOnInit(): void {
  }

  submitSignupForm(): void {
    const url = 'http://localhost:8080/signup';
    const payload = {
      username: this.signupData.username,
      password: this.signupData.password,
      verifyPassword: this.signupData.verifyPassword
    };
    const headers = new HttpHeaders().set('Content-Type', 'application/json');

    this.apiService.signup(payload, headers)
      .subscribe(
        response => {
          console.log('Sign-up successful:', response);
          // Add your logic to navigate to the homepage here
        },
        error => {
          console.error('Sign-up failed:', error);
          if (error.error instanceof ErrorEvent) {
            // Client-side error occurred
            console.error('Client-side error:', error.error.message);
          } else {
            // Server-side error occurred
            console.error('Server-side error:', error.status, error.error);
          }
        }
      );


    console.log('submitted:', this.signupData.username, this.signupData.password, this.signupData.verifyPassword);
  }
}
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>

<body>
    <form (ngSubmit)="submitSignupForm()" #signupForm="ngForm" novalidate>
        <label class="input-label">Sign Up:</label>
        <div class="input-box">
            <label for="username">Username:</label>
            <input type="text" id="username" name="username" [(ngModel)]="signupData.username" required minlength="3"
                maxlength="20">
            <div *ngIf="signupForm.controls.username?.errors?.required">Username is required</div>
            <div *ngIf="signupForm.controls.username?.errors?.minlength">Username should be at least 3 characters</div>
            <div *ngIf="signupForm.controls.username?.errors?.maxlength">Username should not exceed 20 characters</div>
        </div>

        <label for="password">Password:</label>
        <input type="password" id="password" name="password" [(ngModel)]="signupData.password" required>
        <div *ngIf="signupForm.controls.password?.invalid && (signupForm.controls.password?.dirty || signupForm.controls.password?.touched)">
            Password is required
        </div>
        <div *ngIf="signupForm.controls.password?.errors?.required">Password is required</div>
        <div *ngIf="signupForm.controls.password?.errors?.minlength">Password should be at least 6 characters</div>

        <label for="verifyPassword">Verify Password:</label>
        <input type="password" id="verifyPassword" name="verifyPassword" [(ngModel)]="signupData.verifyPassword"
            required>
        <div *ngIf="signupForm.controls.verifyPassword?.invalid && (signupForm.controls.verifyPassword?.dirty || signupForm.controls.verifyPassword?.touched)">
            Verify Password is required
        </div>
        <div *ngIf="signupForm.controls.verifyPassword?.errors?.required">Verify Password is required</div>
        <div *ngIf="signupData.password !== signupData.verifyPassword">Passwords do not match</div>

        <button type="submit" [disabled]="signupForm.invalid || signupData.password !== signupData.verifyPassword">Sign
            Up</button>

    </form>
</body>

</html>
